import React from "react";
import Navbar from "../../../layouts/frontend/Navbar";
function ContentQuestion() {
  return (
    <div>
      {/* <Navbar /> */}
      <header className="ex-header">
        <div className="container">
          <div className="row">
            <div className="col-xl-10 offset-xl-1">
              <h1 className="text-center">Chi tiết câu hỏi</h1>
            </div>
          </div>
        </div>
      </header>
      <div className="content-question-container">
        <div className="card-up">
          <div
            className="breadcrumb"
            style={{ backgroundColor: "white", height: "80px", backgroundColor:"#f25c05", alignItems:"center" }}
          >
             <i className="fa fas fa-home">Trang chủ / PHP Cơ bản / Q 1</i>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ContentQuestion;
